import React, { Component } from 'react';
import './allVacations.css';

export default class AllVacations extends Component {

    render() {
        return (
            <div className="allVacationsSection">
                
                <h3 className="favoritesHeader sharp-text">Your 17 Favorite Vacations <img className="heartGIF" src={heartGIF} alt="Followed GIF"/></h3>

            </div>
        )
    }
}
